import React from 'react'

function ToggleSwitch() {
  return (
    <div>
      <label class="switch">
        Autoplay&nbsp;
        <input type="checkbox" />
        <span class="slider round"></span>
      </label>
    </div>
  );
}

export default ToggleSwitch
